        self.adj = adj
        self.directed = directed

    def minWeight(self, v: int) -> int:
        queue = []
        visited = [False] * self.V
        visited[v] = True
        queue.append(v)

        while queue:
            u = queue.pop(0)
            if visited[u] == False:
